import React, { useState } from "react";
import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";
import {Link} from 'react-router-dom'
import axios from "axios";
import { useNavigate } from "react-router-dom";
import Container from '@mui/material/Container';
import Snackbar from "@mui/material/Snackbar";
import MuiAlert from "@mui/material/Alert";
import { Card, CardContent, CardActions } from "@mui/material";
import HypervergeLogo from "./hva.jpg"; // Replace with the correct file path and name

// import Input from "@mui/material/Input";
import Grid from "@mui/material/Grid";
const Register = () => {
  const [formData, setFormData] = useState({
    email: "",
    password: "",
    name: "",
    address: "",

    phone: "",
  });
  const [error, setError] = useState("");
  const [success, setSuccess] = useState("");
  const [openSnackbar, setOpenSnackbar] = useState(false);

  const navigate = useNavigate();
  const { email, password, name, address,  phone } = formData;

  const onChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };


  const handleRegister = async (e) => {
    e.preventDefault();
    const newUser=  {
      email,
      password,
      name,
      address,

      phone
    }


    try {
      const res = await axios.post(
        "http://localhost:5000/api/user/register",
        newUser

      );
      console.log(res.data);
      setError("");
      setSuccess("Login successful!");
      setOpenSnackbar(true);


      navigate(`/login`);
    } catch (err) {
      setError("Invalid login credentials");
      setSuccess("");
      setOpenSnackbar(true);
      console.error(err.response);
    }
  };

  const handleCloseSnackbar = () => {
    setOpenSnackbar(false);
  };

  return (
    <Container maxWidth="md">
    <Grid container justifyContent="center" alignItems="center" style={{ height: "100vh" }}>
      {/* Left side (Company name and logo) */}
      <Grid item xs={12} md={6} style={{ display: "flex", justifyContent: "center", alignItems: "center" }}>
        <div>
          <img src={HypervergeLogo} alt="Hyperverge Logo" style={{ width: "2000px", height:"800" }} />
          <h1 style={{ fontSize: "24px", marginTop: "16px" }}>Hyperverge</h1>
        </div>
      </Grid>

      {/* Right side (User registration form) */}
      <Grid item xs={12} md={6}>
        <Card style={{ width: "100%", textAlign: "center" }}>
          <CardContent>
            <Grid container direction="column" spacing={2}>
              <Grid item>
                <h2>Register</h2>
              </Grid>


        <Grid item>
        <TextField
id="outlined-controlled"
name="email"
label="Email"
value={email}
onChange={onChange}
fullWidth
/>
<Grid item>
        <TextField
id="outlined-controlled"
name="password"
label="password"
value={password}
onChange={onChange}
fullWidth
/>
</Grid>
<Grid item>
        <TextField
id="outlined-controlled"
name="name"
label="name"
value={name}
onChange={onChange}
fullWidth
/>
</Grid>

<Grid item>
        <TextField
id="outlined-controlled"
name="phone"
label="phone"
value={phone}
onChange={onChange}
fullWidth
 />
</Grid>
</Grid>
              </Grid>
            </CardContent>
            <CardActions style={{ justifyContent: "center" }}>
              <Button onClick={handleRegister} variant="contained" color="primary" fullWidth>
                Register
              </Button>
            </CardActions>
            <p>
              Already have an account? <Link to="/login">Login</Link> here.
            </p>
          </Card>
        </Grid>
      </Grid>



<Snackbar open={openSnackbar} autoHideDuration={3000} onClose={handleCloseSnackbar}>
<MuiAlert
  elevation={6}
  variant="filled"
  onClose={handleCloseSnackbar}
  severity={error ? "error" : "success"}
>
  {error || success}
</MuiAlert>
</Snackbar>
</Container>

  );
};

export default Register;
